import React from "react";
import { Itemreview } from "./Itemreview";

const Reviewslider = () => {
  return (
    <>
      {Itemreview.map((slide, index) => {
        return <img src={slide.Image} alt="review image" />;
      })}
    </>
  );
};

export default Reviewslider;
